import React from 'react';
import { NavLink } from 'react-router-dom';

function Navbar() {
    return (
        <nav className='navbar navbar-expand-lg justify-content-between'>
            <div className="form-inline" id="navbarSupportedContent">
                <ul className="navbar-nav mr-auto ml-auto">
                    <li className='nav-item mr-5'>
                        <NavLink className='text-purple' to='/about'>About Us</NavLink>
                    </li>
                    <li className='nav-item mr-5'>
                        <NavLink className='text-purple' to='/parents'>For Parents</NavLink>
                    </li>
                    <li className='nav-item mr-5'>
                        <NavLink className='text-purple' to='/play'>Play</NavLink>
                    </li>
                </ul>
            </div>
      </nav>
    )
}

export default Navbar;
